import React from "react";
import { Container, Row, Col, Button } from "react-bootstrap";

const Home = () => {
  return (
    <Container className="mt-5 text-center">
      <h1>Welcome to Movie Info Viewer</h1>
      <p className="lead">
        Explore trending movies, search for your favorite films, and more!
      </p>
      <Row className="mt-4">
        <Col md={4}>
          <h3>Trending Movies</h3>
          <p>Stay updated with the latest trending movies.</p>
          <Button variant="primary">Explore Now</Button>
        </Col>
        <Col md={4}>
          <h3>Search Movies</h3>
          <p>Find detailed information about any movie.</p>
          <Button variant="primary">Search Now</Button>
        </Col>
        <Col md={4}>
          <h3>Favorites</h3>
          <p>Save and manage your favorite movies.</p>
          <Button variant="primary">View Favorites</Button>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
